import { Component, OnInit, ViewChild } from '@angular/core';
import { Seller } from '../clases/seller';
import { TokenService } from '../services/token.service';
import { DbService } from '../services/db.service';
import { User } from '../clases/user';
import { QRCodeComponent } from 'angularx-qrcode';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
import { NavController, Platform } from '@ionic/angular';
import { FileOpener } from '@ionic-native/file-opener/ngx';
import { File } from '@ionic-native/file/ngx';

@Component({
  selector: 'app-qr-generator',
  templateUrl: './qr-generator.page.html',
  styleUrls: ['./qr-generator.page.scss'],
})
export class QrGeneratorPage implements OnInit {

  @ViewChild('qr', {static: true}) qr;

  url;
  seller: Seller;
  user: User;
  miQrText: string = "holis";
  a:any;
  b:HTMLCollection;
  urlImg:any;
  letterObj = {
    to: '',
    from: '',
    text: ''
  }
  pdfObj = null;

  constructor( private token: TokenService, 
    private dbs: DbService,
    public navCtrl: NavController, 
    private plt: Platform, 
    private file: File, 
    private fileOpener: FileOpener) {
  

   }

   ver()
   {
    this.a = document.getElementsByTagName('qrcode');
    this.urlImg = this.a[0].children[0].children[0].src
   
    console.log(this.a[0].children[0].children[0].src)
   }



  ionViewWillEnter()
  {
    this.user = this.token.GetPayLoad().usuario;
    this.dbs.checkIsVendor(this.user._id).toPromise().then((data:any)=>
  {
    this.seller= data.vendor_data;
    this.miQrText = "https://ofertacerca.com/#/seller-shop/" + this.seller.shop_name;
  })
  }

  ngOnInit() {
  }


  createPdf() {

    this.a = document.getElementsByTagName('qrcode');
    this.urlImg = this.a[0].children[0].children[0].src
    
    var docDefinition = {
      background: "",
      content: [
      
     /*   {
          image: '/assets/logoOfertaCerca/fondoQr.jpg', 
          width: 150,
          height: 150,
          margin: [0, 70, 0, 0]
        },*/

        {image: 'data:image/jpeg;base64,',
      width:520,
      height:700
      },
      {
        image: this.urlImg, 
        width: 115,
        height: 153,
        absolutePosition: { x: 94, y: 457 }
      },
      ],

      styles: {
        header: {
          fontSize: 18,
          bold: true,
        },

        story: {
          italic: true,
          alignment: 'center',
          width: '100%',
        }
      }

    }
    this.pdfObj = pdfMake.createPdf(docDefinition);
  }
 
  downloadPdf() {
    
    this.createPdf();
    if (this.plt.is('cordova')) {
      this.pdfObj.getBuffer((buffer) => {
        var blob = new Blob([buffer], { type: 'application/pdf' });
        
        // Save the PDF to the data Directory of our App
        this.file.writeFile(this.file.externalDataDirectory, 'qrOfertacerca.pdf', blob, { replace: true }).then(fileEntry => {
          // Open the PDf with the correct OS tools
          this.fileOpener.open(this.file.externalDataDirectory + 'qrOfertacerca.pdf', 'application/pdf');
        })
      });
    } else {
      // On a browser simply use download!
      this.pdfObj.download();
    }
  }

}
